import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import './Navbar.css'; // Import your CSS file for styling

const Navbar = () => {  
  const location = useLocation(); // Get current route

  return (
    <div>
      <nav className="navbar">
        <div className="navbar-brand">
          <img src="/logo.jpg" alt="logo" className="logo" />
        </div>
        <div className="navbar-links">
          <Link to="/home" className={location.pathname === '/' ? 'active' : ''}>Home</Link>
          <Link to="/dashboard" className={location.pathname === '/dashboard' ? 'active' : ''}>Dashboard</Link>
          <Link to="/data-collection" className={location.pathname === '/data-collection' ? 'active' : ''}>Data Collection</Link>
          <Link to="/ai-analysis" className={location.pathname === '/ai-analysis' ? 'active' : ''}>AI Analysis</Link>
          <Link to="/AlertsReports" className={location.pathname === '/ALertsReports' ? 'active' : ''}>Alerts and Reports</Link>
          <Link to="/User" className={location.pathname === '/' ? 'active' : ''}>User Management</Link>
          <Link to="/settings" className={location.pathname === '/settings' ? 'active' : ''}>System Settings</Link>
          <Link to="/profile" className={location.pathname === '/profile' ? 'active' : ''}>Profile</Link>
          <Link to="/login" className={location.pathname === '/' ? 'active' : ''}>Logout</Link>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
